import './Authorization.scss'

import logo from '../../assets/svg/icon.svg'

export const Authorization = () => {
   return (
    <div className="authorization">
        <img src={logo} alt='logo' className='authorization__logo'/>
        <h2 className='authorization__title'>Sign in to 5S Control</h2>
        <input type='text' className='authorization__input' placeholder='Enter Email'/>
        <input type='text' className='authorization__input' placeholder='Enter Password'/>
    </div>
   ) 
}
